import base64
import os

imagebase64 = ""
imagebase64 = base64.b64encode(imagebase64.encode())
pwd = os.getcwd()
pwd += "/test.jpg"
print(pwd)
try:
    os.remove(pwd)
except:
    print("no image with name test found to be deleted !!")
with open(pwd, "wb") as fh:
    fh.write(base64.decodebytes(imagebase64))
